webpackJsonp([66919071224359],{4092:function(t,a){t.exports={data:{markdownRemark:{html:'<p><img src="https://danmaq.com/image/illustrations/pbbs/2005-2007/tohov_003653_s.png" alt="マガトロ人形店"></p>\n<p>自律人形をご用命の際は、動力としてお客様の魂が必要となりますのでご了承ください。</p>\n<p>昭和初期テイストなマガトロ人形店。</p>\n<p>ちなみに幻想郷の20円は現世で言うならハイエンドかつフラッグシップ級な式神クラス。しかも幻想郷では通貨自体そこまで流通していないのでもう少々高く感じるかも。(幻想郷では物々交換が基本だが場慣れしていない場合は通貨で支払うのが一番確実)最低金額20円なので全うな人形を頼むならそれ以上は必要です。</p>\n<p>しかし自律人形を頼むと、どんな良質の人形を依頼しても大抵最低金額の20円で引き受けてくれるらしい。「まだ自律人形は研究段階なので、制作実験のお礼と言う意味でお代は最低料金でサービスしているの」だとか。「あぁ、そうそう自律するからには自分の手入れだけは欠かさないでね。人形本体が壊れたらアウトだから……」……どうやら妹紅には遠く及ばないようだ。</p>',frontmatter:{cover:null,date:"2007-05-15T17:46:00+09:00",strDate:"2007/5/15",title:"[東方] 如何なる人形でも御請け致します"}}},pathContext:{path:"/ja/blog/2007/05/15-東方-如何なる人形でも御請け致します/",langKey:"ja"}}}});
